import React, { useState, useEffect } from 'react';
import { loadDetails } from '../actions/userActions';
import '../styles/home.style.scss';

import ICONS from '../icons/icons';

function Home() {
	function click() {}
	return (
		<>
			<div className="home-holder flex-col">
				<div className="flex-row">
					<div className="flex-col home-category">
						<img src={ICONS.senior} alt="senior" title="senior" />
						<span>SENIOR</span>
					</div>
					<div className="flex-col">
						<img src={ICONS.junior} alt="junior" title="junior" />
						<span>JUNIOR</span>
					</div>
				</div>
				<div className="flex-col">
					<div className="home-spec">
						<p>FRONTEND</p>
					</div>
					<div className="home-spec">
						<p>BACKEND</p>
					</div>
					<div className="home-spec">
						<p>FULLSTACK</p>
					</div>
				</div>
				<button>GO!</button>
			</div>
		</>
	);
}

export default Home;
